embedfield:
How to properly shudown MongoDB before stopping its docker container?<p>I would like to know how I can properly wait for and shutdown a MongoDB server before I stop and remove the docker image that contains it.</p>
<p>This teardown function stops and then removes a MongoDB docker image:</p>
<pre><code>const teardown = async (failOnError = true) =&gt; {
  const dockerCommand = `docker stop ${imageName} &amp;&amp; docker rm ${imageName}`

  return executeCommand(dockerCommand, environment, 'Finished database teardown', failOnError)
}
</code></pre>
<p>Execute command is a wrapper around Node's <code>child_process</code> <a href="https://nodejs.org/dist/latest-v10.x/docs/api/child_process.html#child_process_child_process_exec_command_options_callback" rel="nofollow noreferrer">exec</a> function that returns a promise, here is the full <code>executeCommand</code> helper:</p>
<pre><code>const executeCommand = (command, envObject, resolveMsg, failOnError = true) =&gt; new
Promise((resolve, reject) =&gt; {
  exec(command, envObject, (err, stdout) =&gt; {
    if (err &amp;&amp; failOnError) {
      console.error(`Command ${command} failed with error: `, err)
      reject(err)
    }

    // if we don't error we log the resolve message if one present
    if (!err &amp;&amp; resolveMsg) console.log(resolveMsg)

    // resolve promise with err object if it exists, otherwise resolve with command output
    resolve(err || stdout)
  })
})
</code></pre>
<p>This is how the teardown function is called inside asynchronous functions called by Cypress before and after tests are run:</p>
<pre><code>module.exports = async (on, config) =&gt; {
    on('before:run', async () =&gt; {
    console.log('BEFORE:RUN HOOK')

    // attempt to stop and remove docker images just in case teardown was not called at the end of
    // the last run. Note: will not fail or stop tests if teardown command fails
    await teardown(false)
    await setup()
    await checkHostAcceptingConnections()
  })

  on('after:run', async () =&gt; {
    console.log('AFTER:RUN HOOK')

    await teardown()
  })
}
</code></pre>
<p>Here's the thing: there is no guarantee that the teardown function inside the after run hook will be called (in case the test suite hangs). For this reason it is possible that the container is still up from the last run.</p>
<p>These methods do what they are told, but the problem is that if I call the teardown function and then immediately spin up the MongoDB docker container, the MongoDB outputs errors like &quot;error: socket ended by other party&quot; or &quot;connection 0 to localhost closed&quot;.</p>
<p>Those errors completely disappear if I remove the teardown calls and just leave the docker image up and running - this is fine for local development but our CI may need to retry tests and I prefer to start the docker image with a completely clean slate.</p>
<p>I was under the impression that stopping, removing, and then starting the mongo docker image would also completely reset the image, thus clearing any state. That does not seem to be the case (new to docker).</p>
<p>How should I stop the MongoDB server? I only ever call <code>client.connect()</code> before doing some DB op, and then call <code>client.close()</code> after doing the operation, here is an example of how the database commands look:</p>
<pre><code>const getDocsTotal = async () =&gt; {
  await client.connect()
  const collection = client.db('admin').collection('test-data')
  const totalDocs = await collection.countDocuments({})
  await client.close()
  return totalDocs
}
</code></pre>

