MongoDb 4.x Query with projection without empty entries using find<p>We are now using mongo-db to store data from tests. I am using Mongo-Shell
The document is structured like this:</p>
<pre><code>{
   static1:&quot;abc&quot;,
   static2:&quot;xyz&quot;,
   static3:&quot;asd&quot;, [...],
   nested:[
   {
       data1: &quot;d1&quot;,
       data2: &quot;d2&quot;,
   },
   {
       data1: &quot;dx&quot;,
       data4: &quot;d4&quot;,
       data5: &quot;d5&quot;,
       data6: &quot;d6&quot;,
   },
   {
       data1: &quot;ds&quot;,
       data8:&quot;data8&quot;
   }, [...]
   ]
}
</code></pre>
<p>So the static-data is always in the same structure, but for every measurement the object can look different. It could be voltage with upper, lower and actual value. Or just comparison of a target value and an actual value. Highly dynamic.
Same data1-name represent same attributes.</p>
<p>Now e.g. I want to display only some static data and one (or several) attributes of a nested document.</p>
<p>I am using this query:</p>
<pre><code>find({}, {_id:0, data1:1, &quot;nested.data8&quot;:1}).pretty()
</code></pre>
<p>As expected, only the static-data1 is displayed, but the dynamic measurements has lots of empty objects in the shell-output</p>
<p>Example-Output:</p>
<pre><code>{ 
  &quot;static1&quot; : &quot;123&quot;, 
  &quot;nested&quot; : [
    {  }, 
    {  }, 
    {  }, [...] ,
    { &quot;data8&quot; : &quot;OK&quot; } 
] }
</code></pre>
<p>The desired output would be:</p>
<pre><code>{ 
   &quot;static1&quot; : &quot;123&quot;, 
   &quot;nested&quot; : [
         { &quot;data8&quot; : &quot;d8&quot; } 
    ] 
}
</code></pre>
<p>I also tried this query on the mongo shell:</p>
<pre><code>aggregate( { $addFields: {&quot;static&quot;:&quot;$static1&quot;, &quot;data8&quot;:&quot;$nested.data8&quot;} },  { $project:{&quot;static1&quot;:1, &quot;nested.data8&quot;:1} } ).pretty()
</code></pre>
<p>But the result is the same.
I hope there is a ways to get rid of the empty documents in the output.</p>
<p>Thanks</p>

