  if (err) return handleError(err);
  // saved!
});
</code></pre>
<p>or</p>
<pre><code>SomeModel.create({ name: 'also_awesome' }, function (err, awesome_instance) {
  if (err) return handleError(err);
  // saved!
});
</code></pre>
<p>However, in the JS script given to fill the DB with data, it seems that both syntaxes are used, here is an example:</p>
<pre><code>function authorCreate(first_name, family_name, d_birth, d_death, cb) {
