<li>the script works the same if I delete all callbacks from arguments &quot;defined&quot; in functions and their respective calling</li>
<li>What is the point of cb(null, author): no data need to be return, they are push to the declared array and saved to the DB at the same time.</li>
</ul>
<p>The full script can be found here: <a href="https://raw.githubusercontent.com/hamishwillee/express-locallibrary-tutorial/master/populatedb.js" rel="nofollow noreferrer">https://raw.githubusercontent.com/hamishwillee/express-locallibrary-tutorial/master/populatedb.js</a></p>
